import React, {Components} from 'react'
import {Nav} from 'react-bootstrap'

class Left extends React.Component{
    render(){
      return(
        <div> 
          <Nav defaultActiveKey="/home" className="flex-column">
            <Nav.Link href="/" style={{color: "#555B6E"}}>Home</Nav.Link>
            <Nav.Link href="/about" style={{color: "#555B6E"}}>About</Nav.Link>
            <Nav.Link href="/help" style={{color: "#555B6E"}}>Help</Nav.Link>
          </Nav>
        </div>
      )
    }
  }

export default Left;
